function(){
  function splitHostname() {
    var result = {};
    var regexParse = new RegExp('([a-z\-0-9]{2,63})\.([a-z\.]{2,5})$');
    var urlParts = regexParse.exec(window.location.hostname);
    if(urlParts !== null && urlParts.length > 1) {
      result.domain = urlParts[1];
      result.type = urlParts[2];
      result.subdomain = window.location.hostname.replace(result.domain + '.' + result.type, '').slice(0, -1);;
      return result;
    } else {
      return undefined;
    }
  }

  function setCookie(cookieName, cookieValue, cookieExpire, cookiePath, cookieDomain){
    var cookieText=escape(cookieName)+'='+escape(cookieValue);
    cookieText+=(cookieExpire ? '; EXPIRES='+cookieExpire.toGMTString() : '');
    cookieText+=(cookiePath ? '; PATH='+cookiePath : '');
    cookieText+=(cookieDomain ? '; DOMAIN='+cookieDomain : '');
    document.cookie=cookieText;
  }

  function setTimeForCookies (minutes) {
    var now = new Date();
    var time = now.getTime();

    time += 365 * 24 * 60 * 60 * 1000;
    now.setTime(time);
    return now;
  }

    var getCookie = function(name) {
    var i, x, y, ARRcookies = document.cookie.split(";");
    for (i = 0; i < ARRcookies.length; i++) {
      x = ARRcookies[i].substr(0, ARRcookies[i].indexOf("="));
      y = ARRcookies[i].substr(ARRcookies[i].indexOf("=") + 1);
      x = x.replace(/^\s+|\s+$/g, "");
      if (x == name) {
        return unescape(y);
      }
    }
  }

  if(getCookie('_ga_cid') !== undefined && getCookie('_ga_cid').typeOf == 'undefiend') return getCookie('_ga_cid');
  else if(document.URL.indexOf('_ga') > -1) {
    var hostInfo = splitHostname();
    var tmphost = document.location.hostname.replace(hostInfo.subdomain + '.','').split('.').length;
    var gaCookie = undefined;
    for(var i=0;i<document.location.search.split('?').length;i++){
      if(document.location.search.split('?')[i].indexOf('_ga') > -1){
          gaCookie = document.location.search.split('?')[i].split('-')[1];
        }
    }
    setCookie('_ga', 'GA1.' + tmphost + '.' + gaCookie, 
              setTimeForCookies(2), '/', '.' + hostInfo.domain + '.' + hostInfo.type);
  }
  else if(getCookie('_ga') !== undefined) return getCookie('_ga').substring(6);
  else if(getCookie(' _ga') !== undefined) return getCookie(' _ga').substring(6);
  else {
    setCookie('_ga', 'GA1.' + tmphost + '.' + Math.floor(Math.random() * 9000000000) + 1000000000 + '.' + Math.floor(new Date().getTime() / 1000), setTimeForCookies(2), '/', '.' + hostInfo.domain + '.' + hostInfo.type);
    return getCookie(' _ga').substring(6);
  }
}

